          <option value={""} disabled hidden>
            Select a month
          </option>
          {options.map((option) => (
            <option key={option.value} value={option.value}>
              {option.label}
            </option>
          ))}
        </select>
      </label>
      <p>We eat  :{ value}!</p>
    </div>
  );
};

export default App;
